import React from "react";

function Entity(props){

    return (
        <div className="term">
          <dt>
            <span className="emoji" role="img" aria-label="Tense Biceps">
              {props.emoji}
            </span>
            <span>{props.name}</span>
          </dt>
          <dd>
             {props.content.substring(0,100)}
          </dd>
        </div>
    );
}

export default Entity;
